import React, { useState } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [report, setReport] = useState(null);
  const [filePath, setFilePath] = useState('trace.har');

  const generateReport = async () => {
    setLoading(true);
    setError(null);
    setReport(null);

    try {
      // Get main analysis
      const mainResponse = await axios.post('/api/analyze', {
        file_path: filePath
      });

      if (!mainResponse.data.success) {
        throw new Error(mainResponse.data.error || 'Main analysis failed');
      }

      // Get pattern analysis
      const patternResponse = await axios.get('/api/analytics/patterns', {
        params: {
          file_path: filePath,
          sort_by: 'requests',
          limit: 50
        }
      });

      if (!patternResponse.data.success) {
        throw new Error(patternResponse.data.error || 'Pattern analysis failed');
      }

      // Combine results into comprehensive report
      const mainData = mainResponse.data.data;
      const patternData = patternResponse.data.data;

      const comprehensiveReport = {
        summary: {
          total_requests: mainData.summary.total_requests,
          total_errors: mainData.summary.error_count,
          total_endpoints: mainData.endpoint_analysis?.total_endpoints || 0,
          total_patterns: patternData.total_patterns,
          success_rate: mainData.summary.success_rate,
          processing_time: mainData.summary.processing_time_seconds,
          error_4xx: mainData.error_analysis?.error_types?.['4xx'] || 0,
          error_5xx: mainData.error_analysis?.error_types?.['5xx'] || 0
        },
        top_issues: {
          slowest_endpoints: mainData.latency_analysis?.top_slow_endpoints?.slice(0, 5) || [],
          error_endpoints: mainData.error_analysis?.top_error_endpoints?.slice(0, 5) || []
        },
        pattern_analysis: {
          patterns: patternData.patterns,
          top_patterns_by_requests: patternData.patterns.slice(0, 10),
          top_patterns_by_errors: patternData.patterns
            .filter(p => p.error_4xx_count + p.error_5xx_count > 0)
            .sort((a, b) => (b.error_4xx_count + b.error_5xx_count) - (a.error_4xx_count + a.error_5xx_count))
            .slice(0, 5),
          top_patterns_by_latency: patternData.patterns
            .filter(p => p.avg_latency_ms > 0)
            .sort((a, b) => b.avg_latency_ms - a.avg_latency_ms)
            .slice(0, 5)
        },
        dependency_analysis: mainData.dependency_analysis || {},
        response_codes: mainData.response_codes,
        analysis_info: {
          file_path: mainData.file_path,
          timestamp: mainData.analysis_timestamp,
          cached: mainResponse.data.cached
        }
      };

      setReport(comprehensiveReport);
    } catch (err) {
      setError(err.response?.data?.error || err.message || 'Analysis failed');
    } finally {
      setLoading(false);
    }
  };

  const StatCard = ({ number, label, color = '#667eea' }) => (
    <div className="stat-card" style={{ borderLeft: `4px solid ${color}` }}>
      <div className="stat-number" style={{ color }}>{number}</div>
      <div className="stat-label">{label}</div>
    </div>
  );

  const ResponseCodeItem = ({ code, count }) => (
    <div className="code-item">
      <div className="code-number">{code}</div>
      <div className="code-count">{count} responses</div>
    </div>
  );

  const DependencyItem = ({ dependency }) => (
    <div className="dependency-item" style={{
      padding: '0.75rem',
      margin: '0.5rem 0',
      backgroundColor: '#f8f9fa',
      borderRadius: '6px',
      border: '1px solid #e9ecef'
    }}>
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start', marginBottom: '0.5rem' }}>
        <div style={{ flex: 1 }}>
          <div style={{ fontWeight: 'bold', color: '#495057', marginBottom: '0.25rem' }}>
            {dependency.resource_type} - {dependency.url.split('/').pop() || dependency.url}
          </div>
          <div style={{ fontSize: '0.85rem', color: '#6c757d', wordBreak: 'break-all' }}>
            {dependency.url}
          </div>
        </div>
        <div style={{ textAlign: 'right', marginLeft: '1rem' }}>
          <div style={{ fontWeight: 'bold', color: '#dc3545' }}>
            {dependency.response_time.toFixed(2)}ms
          </div>
          {dependency.size_bytes && (
            <div style={{ fontSize: '0.8rem', color: '#6c757d' }}>
              {(dependency.size_bytes / 1024).toFixed(1)}KB
            </div>
          )}
        </div>
      </div>
      <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(100px, 1fr))', gap: '0.5rem', fontSize: '0.8rem' }}>
        <div><strong>Status:</strong> {dependency.status_code || 'N/A'}</div>
        <div><strong>Type:</strong> {dependency.resource_type}</div>
        {dependency.mime_type && <div><strong>MIME:</strong> {dependency.mime_type}</div>}
      </div>
    </div>
  );

  const EndpointItem = ({ endpoint, type = 'endpoint', dependencies = null }) => {
    const [showDependencies, setShowDependencies] = useState(false);

    return (
      <li className="endpoint-item" style={{ 
        borderLeft: type === 'slow' ? '4px solid #ff6b6b' : 
                    type === 'error' ? '4px solid #ff4757' : 
                    '4px solid #667eea' 
      }}>
        <div className="endpoint-url">
          <strong>{endpoint.method || endpoint.url?.split(' ')[0]}</strong> {endpoint.url || endpoint.pattern}
        </div>
        <div className="endpoint-details">
          <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(120px, 1fr))', gap: '0.5rem', marginTop: '0.5rem' }}>
            <div><strong>Total Requests:</strong> {endpoint.total_requests || endpoint.request_count}</div>
            <div><strong>Success Rate:</strong> {endpoint.success_rate || 'N/A'}%</div>
            <div><strong>200 Success:</strong> {endpoint.success_count || 'N/A'}</div>
            <div><strong>4xx Errors:</strong> {endpoint.error_4xx_count || 0}</div>
            <div><strong>5xx Errors:</strong> {endpoint.error_5xx_count || 0}</div>
            <div><strong>Avg Latency:</strong> {endpoint.avg_latency_ms || 'N/A'}ms</div>
            {endpoint.max_latency_ms && <div><strong>Max Latency:</strong> {endpoint.max_latency_ms}ms</div>}
          </div>

          {endpoint.example_urls && endpoint.example_urls.length > 0 && (
            <div style={{ marginTop: '0.5rem' }}>
              <strong>Example URLs:</strong>
              <ul style={{ margin: '0.25rem 0 0 1.5rem', fontSize: '0.85rem' }}>
                {endpoint.example_urls.slice(0, 2).map((url, index) => (
                  <li key={index} style={{ wordBreak: 'break-all' }}>{url}</li>
                ))}
              </ul>
            </div>
          )}

          {/* Dependency Analysis Section */}
          {dependencies && dependencies.total_dependencies > 0 && (
            <div style={{ marginTop: '1rem', borderTop: '1px solid #e9ecef', paddingTop: '1rem' }}>
              <button
                onClick={() => setShowDependencies(!showDependencies)}
                style={{
                  background: 'none',
                  border: '1px solid #007bff',
                  color: '#007bff',
                  padding: '0.5rem 1rem',
                  borderRadius: '4px',
                  cursor: 'pointer',
                  fontSize: '0.9rem',
                  display: 'flex',
                  alignItems: 'center',
                  gap: '0.5rem'
                }}
              >
                {showDependencies ? 'â–¼' : 'â–¶'} 
                Dependency Bottlenecks ({dependencies.total_dependencies} resources)
                {dependencies.total_dependency_time > 0 && (
                  <span style={{ fontSize: '0.8rem', color: '#6c757d' }}>
                    ({dependencies.total_dependency_time.toFixed(2)}ms total)
                  </span>
                )}
              </button>

              {showDependencies && (
                <div style={{ marginTop: '1rem' }}>
                  {dependencies.dependency_bottlenecks && dependencies.dependency_bottlenecks.length > 0 ? (
                    <div>
                      <h4 style={{ margin: '0 0 0.5rem 0', color: '#495057' }}>ðŸš¨ Top Bottlenecks:</h4>
                      {dependencies.dependency_bottlenecks.slice(0, 5).map((dep, index) => (
                        <DependencyItem key={index} dependency={dep} />
                      ))}
                    </div>
                  ) : (
                    <div style={{ color: '#6c757d', fontStyle: 'italic' }}>
                      No significant bottlenecks detected
                    </div>
                  )}
                </div>
              )}
            </div>
          )}
        </div>
      </li>
    );
  };

  return (
    <div className="App">
      <div className="header">
        <h1>HAR Analyzer</h1>
        <p>Comprehensive HTTP Archive Analysis Report</p>
      </div>

      <div className="container">
        {/* Analysis Controls */}
        <div className="card">
          <h2>Generate Analysis Report</h2>
          <div style={{ display: 'flex', gap: '1rem', alignItems: 'center', marginBottom: '1rem' }}>
            <input
              type="text"
              value={filePath}
              onChange={(e) => setFilePath(e.target.value)}
              placeholder="Enter HAR file path"
              style={{
                flex: 1,
                padding: '12px',
                border: '1px solid #ddd',
                borderRadius: '6px',
                fontSize: '1rem'
              }}
            />
            <button
              className="button"
              onClick={generateReport}
              disabled={loading}
              style={{ 
                backgroundColor: '#28a745',
                fontSize: '1.1rem',
                padding: '14px 28px'
              }}
            >
              {loading ? 'Generating Report...' : 'ðŸ“Š Generate Report'}
            </button>
          </div>

          <p style={{ color: '#666', fontSize: '0.9rem' }}>
            Default file: trace.har (329MB) - This will generate a comprehensive report with pattern analysis
          </p>
        </div>

        {/* Error Display */}
        {error && (
          <div className="error">
            <strong>Error:</strong> {error}
          </div>
        )}

        {/* Loading State */}
        {loading && (
          <div className="loading">
            <h3>ðŸ”„ Generating Comprehensive Report...</h3>
            <p>Analyzing HAR file and inferring patterns, please wait...</p>
          </div>
        )}

        {/* Comprehensive Report */}
        {report && (
          <>
            {/* Executive Summary */}
            <div className="card">
              <h2>ðŸ“‹ Executive Summary</h2>
              <div className="stats-grid">
                <StatCard
                  number={report.summary.total_requests.toLocaleString()}
                  label="Total Requests"
                  color="#667eea"
                />
                <StatCard
                  number={report.summary.total_errors.toLocaleString()}
                  label="Total Errors"
                  color="#ff4757"
                />
                <StatCard
                  number={report.summary.total_endpoints.toLocaleString()}
                  label="Unique Endpoints"
                  color="#2ed573"
                />
                <StatCard
                  number={report.summary.total_patterns.toLocaleString()}
                  label="API Patterns"
                  color="#ffa502"
                />
                <StatCard
                  number={report.summary.success_rate}
                  label="Success Rate (%)"
                  color="#3742fa"
                />
                <StatCard
                  number={report.summary.processing_time}
                  label="Processing Time (s)"
                  color="#ff6348"
                />
              </div>

              <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(200px, 1fr))', gap: '1rem', marginTop: '1rem' }}>
                <div style={{ background: '#fff3cd', padding: '1rem', borderRadius: '6px', border: '1px solid #ffeaa7' }}>
                  <strong>4xx Errors:</strong> {report.summary.error_4xx.toLocaleString()}
                </div>
                <div style={{ background: '#f8d7da', padding: '1rem', borderRadius: '6px', border: '1px solid #f5c6cb' }}>
                  <strong>5xx Errors:</strong> {report.summary.error_5xx.toLocaleString()}
                </div>
              </div>
            </div>

            {/* Pattern Analysis Section */}
            <div className="card">
              <h2>ðŸ” Api Analysis</h2>


              {/* Top Patterns by Requests */}
              <div style={{ marginBottom: '2rem' }}>
                <h3 style={{ color: '#667eea', borderBottom: '2px solid #667eea', paddingBottom: '0.5rem' }}>
                  ðŸ“Š Top 5 APIs by Request Volume
                </h3>
                <ul className="endpoint-list">
                  {report.pattern_analysis.top_patterns_by_requests.slice(0, 5).map((pattern, index) => (
                    <EndpointItem key={index} endpoint={pattern} type="pattern" />
                  ))}
                </ul>
              </div>

              {/* Top Patterns by Errors */}
              <div style={{ marginBottom: '2rem' }}>
                <h3 style={{ color: '#ff4757', borderBottom: '2px solid #ff4757', paddingBottom: '0.5rem' }}>
                  âš ï¸ Top 5 APIs by Error Rate
                </h3>
                {report.pattern_analysis.top_patterns_by_errors.length > 0 ? (
                  <ul className="endpoint-list">
                    {report.pattern_analysis.top_patterns_by_errors.map((pattern, index) => (
                      <EndpointItem key={index} endpoint={pattern} type="error" />
                    ))}
                  </ul>
                ) : (
                  <p style={{ color: '#666', fontStyle: 'italic' }}>No error patterns found</p>
                )}
              </div>

              {/* Top Patterns by Latency */}
              <div>
                <h3 style={{ color: '#ff6b6b', borderBottom: '2px solid #ff6b6b', paddingBottom: '0.5rem' }}>
                  ðŸŒ Top 5 APIs by Latency
                </h3>
                {report.pattern_analysis.top_patterns_by_latency.length > 0 ? (
                  <ul className="endpoint-list">
                    {report.pattern_analysis.top_patterns_by_latency.map((pattern, index) => (
                      <EndpointItem key={index} endpoint={pattern} type="slow" />
                    ))}
                  </ul>
                ) : (
